def tree_to_table(tree, parent=None, level=None):
    if level is None:
        level = []

    table = []
    for node in tree:
        table.append({
            'id': node['name'],
            'parentId': parent,
            'level': node['head']
        })
        if 'children' in node:
            level.append(node['head'])
            table.extend(tree_to_table(node['children'], node['name'], level))
            level.pop()
    return table

